import "./App.css";
import Home from "./component/Home";
import Navbar from "./component/Navbar";
import { Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Navbar />
      <Route path="/">
        <Home />
      </Route>
    </div>
  );
}

export default App;
